import logo from './logo.svg';
import './App.css';
import CollegeList from './components/CollegeList';
import FilterBar from './components/FilterBar';

const columns = [
  { id: 'name', label: 'Name', minWidth: 170 },
  { id: 'age', label: 'Age', minWidth: 100 },
];

function App() {
  return (
    <div className="App">
      <FilterBar></FilterBar>
      <div className="list">
        <CollegeList list={[{name: "Naman Agrawal", age: 13}], columns={columns}}></CollegeList>
      </div>
    </div>
  );
}

export default App;
